Description, male
(n = 6): Idiosoma small (L/W 559 (466–559)/392 (334–402)) (
Fig. 11
); integument dorso-laterally lined, dorso-medially and ventrally rather granular; posterior dorsal plate large (L/W 179 (174–191)/145 (123–167)), rounded rectangular-oval, posteriorly wider (
Fig. 12
), anterior dorsal platelets oval (L/W 49 (39–50)/39 (29–42)), one pair of small knob-shaped sclerites anterior to Dgl–3; glandularia extended; lateral eyes, separated on both sides, lying free under the integument, very close lateral to Dgl–2 (
Fig. 12
); Cx-I medially closely approached, but separated (
Fig. 11
), postero-lateral margin of Cx-II overlapping Cx-III; medial margin of Cx-III extended by fine secondary sclerotization, medial margin of Cx-IV curved to latero-caudally, with small, knob-shaped caudal corner (
Fig. 11
), caudally extended by secondary sclerotization (
Fig. 11
); Cxgl-2 fused with Cx-III, Cxgl-4 closely approached to the anterior margin of Cx-III (
Fig. 11
); genital field small, rectangular-oval, genital flaps, anteriorly slightly tapering (
Fig.11
); acetabula mid-sized, slender (L/W 29–37 (32–37)/10–11 (7–11)) oval, slightly distant from each other, Ac1 and Ac3 distant from anterior and caudal margin of genital flaps respectively (
Fig. 11
); anterior genital sclerite small with medial bump (
Fig. 11
), posterior genital sclerite large, broader than genital field (
Fig. 11
); excretory pore without sclerotization; Vgl extended by secondary sclerotization, four small, irregular platelets on a curved line parallel the caudal margin of idiosoma (
Fig. 11
); genital skeleton compact, relatively broad, brachia distalia and proximalia strong, directed to caudo-lateral, carina anterior distinct, proximal sclerite elongated, cella proximalis distinct (
Fig. 13
); legs bearing several large setae (several pinnate, distally mostly flatly broadened); leg-I to leg-III terminate in well developed claws with one small dorsal and one larger ventral clawlet (
Fig. 14
), leg-IV-6 distally tapering with one larger terminal seta (
Fig. 15
); capitulum compact, ventrally relatively straight, no distinct rostrum (
Fig. 16
), palps typical (
Figs 16, 17
), P1 with one fine dorsal seta, P2 with one relatively short latero-ventral seta and five to six dorsal setae, ventral margin straight, P3 with two laterodorsal and two latero-medial setae, ventral margin curved, P4 relatively straight, ventro-distally slightly curved, ventral setae slightly distal on weak protrusions (
Figs 16, 17
), chelicera with strong, pointed claw (
Fig. 16
).

Female
