Deutonymph
(n = 1): Idiosoma rounded-oval (L/W 353/294) (
Fig. 20
); integument granular, also coarsely lined dorsally, ventrally only indistinct lines visible; posterior dorsal plate small, irregularly rounded (L/W 40/44), anterior dorsal platelets irregularly oval (L/W 27/20), small knob-shaped sclerite antero-medial to Dgl-3; glandularia on slightly extended platelets, setae of Dgl-3, -4 and -5 long (
Fig. 21
